async function generatePacks(numToGenerate: number) {
	// await RNFS.readFile(newPuzzlesFn, "utf-8")
	let newPuzzles = JSON.parse(newPuzzlesText) as PuzzleData["standard"][]

	// const usedPuzzlesText = await RNFS.readFile(usedPuzzlesFn, "utf-8")
	let usedPuzzles = JSON.parse(usedPuzzlesText) as PuzzleData["standard"][]

	const usedIndices: number[] = []
	const packs: PuzzleData["standard"][][] = []
	for (let packNum = 0; packNum < numToGenerate; packNum++) {
		const pack: PuzzleData["standard"][] = []
		const usedSolutionWords = new Set<string>()
		for (let puzzleNum = 0; puzzleNum < packLength; puzzleNum++) {
			while (true) {
				const index = _.random(0, newPuzzles.length, false)
				const puzzle = newPuzzles[index]
				if (
					usedIndices.includes(index) ||
					usedSolutionWords.has(puzzle.solution)
				) {
					continue
				}
				pack.push(puzzle)
				usedSolutionWords.add(puzzle.solution)
				usedIndices.push(index)
				break
			}
		}
		packs.push(pack)
	}
	newPuzzles = newPuzzles.filter((_, index) => !usedIndices.includes(index))
	usedPuzzles.push(...packs.flat())

	// await RNFS.writeFile(newPuzzlesFn, JSON.stringify(newPuzzles))
	// await RNFS.writeFile(usedPuzzlesFn, JSON.stringify(usedPuzzles))

	return packs
}

async function createWeek(startDate: Date, title: string) {
	const packsInWeek = 7

	console.log("Generating packs\n")
	const packs = await generatePacks(packsInWeek)

	console.log(packs, "\n")

	console.log("Adding week to DB\n")
	const [weekId] = await addWeeks([{ startDate, title }])

	console.log("Adding packs to DB\n")
	const packIds = await addPacks(weekId, Object.values(DayOfWeekText))

	console.log("Adding puzzles to DB\n")
	for (let index = 0; index < packsInWeek; index++) {
		await addPuzzles(packIds[index], packs[index])
	}
	console.log("Done")
}

export function addWeek() {
	const date = new Date()
	date.setDate(2)
	createWeek(date, "Week 1")
	date.setDate(9)
	createWeek(date, "Week 2")
	date.setDate(16)
	createWeek(date, "Week 3")
	date.setDate(23)
	createWeek(date, "Week 4")
}
